class Student:
    def __init__(self, name , ID):
        self.name = name #普通变量，通过参数传进来的
        self.ID = ID
        self.grade_dick = {"语文":0,"数学":0,"英语":0} #这里定义了一个字典但不是参数，因为每个对象都拥有一样的初始值，也就不需要从参数这里获取，可以直接定义
    def grades(self,coures,grade):
        if coures in self.grade_dick:
            self.grade_dick【coures】 = grade#这里用到了字典的知识 注意很容易看成”增加“，这里是”替换“！！！
    def print_grades(self):
        print(f"学生{self.name},学号{self.ID}的成绩为:")
        for course,grade in self.grade_dick.items(): #这里用到了字典的知识和for循环的知识还可以写成 for course in self.grade_dick ():
            #course,grade也就是键和值在grade_dick里循环然后得到下边的结果
            print(f"{course}:{self.grade_dick【course】}分")

bai = Student("小白", "20150101")
# print(bai.name)
bai.grades("英语",99)
bai.grades("数学",66)
